INSERT INTO `about` (`id_abt`, `deskripsi`) VALUES
(1, '### Selamat datang di Markiba (Mari Kita Baca)!\r\n\r\nMarkiba adalah sebuah platform yang didedikasikan untuk para pencinta literasi dan pembaca setia. Kami percaya bahwa kekuatan kata-kata memiliki kemampuan untuk menginspirasi, mengubah pandangan hidup, dan membuka jendela ke dunia yang baru. Dengan semangat ini, Markiba hadir sebagai wadah yang memfasilitasi pembacaan dan berbagi pandangan tentang berbagai karya sastra.\r\n\r\n### Apa yang Kami Lakukan:\r\n\r\n1. *Ulasan Buku yang Mendalam:*\r\n   Tim Markiba secara khusus memilih dan mengulas beragam genre buku dengan cermat. Kami menyajikan ulasan yang mendalam dan obyektif, memberikan gambaran menyeluruh tentang isi, gaya penulisan, dan pesan yang ingin disampaikan oleh setiap karya.\r\n\r\n2. *Komunitas Pembaca yang Aktif:*\r\n   Markiba bukan hanya sekadar platform ulasan, tetapi juga komunitas pembaca yang aktif. Bergabunglah dengan ribuan pembaca lainnya untuk berbagi pengalaman, merekomendasikan buku, dan mendiskusikan berbagai topik menarik seputar literasi.\r\n\r\n3. *Konten Beragam dan Inspiratif:*\r\n   Selain ulasan buku, Markiba juga menyajikan konten beragam seperti artikel, tips membaca, dan wawancara dengan penulis terkenal. Kami berkomitmen untuk menjadi sumber inspirasi dan pengetahuan bagi para pencinta buku.\r\n\r\n### Siapa Kami:\r\n\r\nKami adalah tim individu yang bersemangat tentang literasi dan seni membaca. Setiap anggota tim Markiba memiliki minat yang mendalam dalam membawa pengalaman membaca yang bermakna kepada Anda.\r\n\r\n### Bergabunglah dengan Markiba:\r\n\r\nMari bergabung dengan kami di perjalanan literasi ini! Ikuti kami di media sosial, berlangganan buletin kami, dan jadilah bagian dari komunitas pembaca yang dinamis.\r\n\r\nTerima kasih telah memilih Markiba sebagai teman setia Anda dalam mengeksplorasi dunia literasi. Mari kita baca bersama di Markiba!');

