INSERT INTO `artikel` (`id_artikel`, `judul_artikel`, `sumber`, `penulis`, `tanggal`, `gambar`, `isi_artikel`) VALUES
(1, 'Menulis: Kompleksitas dalam Kesederhanaan', 'Kompas', 'Yose', '2023-12-13', , 'Menulis, seringkali dianggap sepele dibandingkan membaca. Aktivitas ini sering terlihat sederhana, namun di baliknya tersimpan kompleksitas yang unik. Orang kadang meremehkan, menganggap ide dapat datang dari mana saja, tanpa menyadari kompleksitas di balik karya tulis.\r\n\r\nTere Liye, atau Ahmad Fuadi, merupakan penulis Indonesia yang menggugah pembaca lewat karya-karyanya. Lahir pada [tanggal lahir], ia telah menorehkan warisan sastra yang menginspirasi.\r\n\r\nGaya bahasa indah Tere Liye menciptaka');
INSERT INTO `artikel` (`id_artikel`, `judul_artikel`, `sumber`, `penulis`, `tanggal`, `gambar`, `isi_artikel`) VALUES
(2, 'Tips Membaca Aktif ala Najwa Shihab untuk Pemahaman', 'Hipwee', 'Cindy', '2023-12-15', , 'Najwa Shihab memberikan tips membaca aktif yang dapat meningkatkan pemahaman Anda terhadap bacaan. Berikut adalah tips singkatnya:\r\n\r\nMenguntai dan Meraih Makna:\r\nMembaca bukan sekadar mengeja kata-kata, tapi juga meraih makna di setiap kalimat untuk memahami secara menyeluruh.\r\n\r\nBedakan Mengeja dengan Membaca:\r\nMengeja hanya mengartikan huruf, sementara membaca melibatkan interpretasi makna. Pastikan Anda memahami pesan yang ingin disampaikan.\r\n\r\nPahami Karakter Tokoh dalam Fiksi:\r\nDalam buku ');
INSERT INTO `artikel` (`id_artikel`, `judul_artikel`, `sumber`, `penulis`, `tanggal`, `gambar`, `isi_artikel`) VALUES
(4007, 'Sangat Marah dengan Pembajakan Buku, Tere Liye Lontarkan Kritikan Keras. Tuai Beragam Komentar', 'Hipwee', 'Seno', '2024-01-03', , 'Pembajakan masih menjadi permasalahan yang sulit diatasi di Indonesia, mencakup berbagai jenis barang dari baju hingga karya seni. Salah satu figur terkenal, Tere Liye, baru-baru ini mengeluarkan keluhan keras terkait pembajakan bukunya melalui postingan di Facebook pada 22 Mei 2021. Tere Liye mengekspresikan ketidakpuasannya terhadap pembajakan yang merajalela dan mengkritik pembeli buku bajakan. Dalam postingan tersebut, Tere Liye menjelaskan bahwa buku asli harus membayar pajak dan biaya lainnya, sehingga tidak dapat dijual dengan harga murah seperti buku bajakan.\r\n\r\nTere Liye juga menyayangkan perilaku pembaca yang masih membeli buku bajakan, sambil memberikan saran untuk menggunakan alternatif legal dan murah. Postingan Tere Liye mendapat tanggapan pro dan kontra di media sosial, termasuk kritik terhadap bahasa kasarnya terhadap pembeli buku bajakan.\r\n\r\nPengguna Twitter @harisFQ mengunggah ulang postingan Tere Liye dan menilai bahwa bahasa kasar tersebut tidak pantas, terutama karena mayoritas pembacanya adalah anak SMP dan SMA yang mungkin belum memahami isu pembajakan. Diskusi pun timbul di media sosial, dengan sebagian mendukung Tere Liye karena kekesalannya terhadap pembajakan, dan sebagian lainnya mengkritik bahasa yang dianggap kasar.\r\n\r\nRaditya Dika, seorang penulis dan komika, juga merespons pembajakan buku melalui Instagram Story, menyampaikan kesedihan dan kecewa karena masih banyak pembaca yang mencari buku bajakan. Raditya Dika juga mengakui ketidakmampuan untuk mengatasi pembajakan dan kurangnya dukungan pemerintah dalam memerangi praktik ini.');

